package com.example.events.domain.model;import com.example.events.domain.vo.*;import java.util.UUID;public final class Event {    private final EventId eventId;    private final VenueId venueId;    private final EventName eventName;    private final Capacity capacity;    private final TimeSlot timeSlot;    private EventStatus status;    public Event(EventId enEventI, EventName eventName, Capacity capacity, TimeSlot timeSlot,  VenueId venueId, EventStatus status) {        this.eventId = enEventI;        this.eventName = eventName;        this.capacity = capacity;        this.timeSlot = timeSlot;        this.status = status;        this.venueId = venueId;    }    public EventId getEventId() {        return eventId;    }    public EventName getEventName() {        return eventName;    }    public Capacity getCapacity() {        return capacity;    }    public TimeSlot getTimeSlot() {        return timeSlot;    }    public EventStatus getStatus() {        return status;    }    public VenueId getVenueId() {        return venueId;    }    public void setStatus(EventStatus status) {        this.status = status;    }    public UUID id(){        return eventId.value();    }}